import React from 'react';
import styled from 'styled-components';
// import Row from 'react-bootstrap/Row';
// import Col from 'react-bootstrap/Col';
// import Container from 'react-bootstrap/Container';


const FlexWrapper = styled('div')`

    border: 1px solid #c7c2c2;
    background: #fff;
    margin-bottom: 10px;
    min-height: 100px;
    border-radius: 10px;
    padding: 10px 0;
    height: 120px;

`


const TextWrap = styled('div')`
	font-size:15px;
	font-weight:bold;
	color:#000066;
`
const ParaWrap = styled('div')`
	font-size:12px;
	color:grey;
`
const ButtonWrap = styled('div')`
	border: 1px solid #007bff;
    color: white;
    font-size: 10px;
    background:green;
    width:15%;
    border-radius:5px;
    font-weight:bold;
    text-align:centre;
    height:25px;

`
const DoseWrap = styled('div')`
	margin-left:100px;
`
const Row = styled('div')`
	display:  flex;
	flex-direction: row;
	border : 1px solid white;
    margin-top:5px;
    justify-content: space-between;
    padding: 7px;
    height: 70px;
`
const Col = styled('div')`
	display:  flex;
	flex-direction: column;
	border : 1px solid white;
	width:30%;
`
const RowWrapper = styled('div')`
	display:  flex;
	flex-direction: row;
	border : 1px solid white;
	justify-content: flex-end;
	font-weight:bold;
`


const Card = () => (
	<FlexWrapper>
        <TextWrap>HSC GOVINDPUR</TextWrap>
        <Row>
			<Col>
			   <ParaWrap>HSC GOBINDPUR,BOKARO THERMAL,JHARKHAND,829107</ParaWrap> 
			</Col>
			<Col>
			   <RowWrapper>Covishield</RowWrapper>
			   <RowWrapper>
			         <ButtonWrap>FREE</ButtonWrap>
			   </RowWrapper>
			</Col>
        </Row>
	</FlexWrapper>
)

export default Card;
